import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import "./styles/App.scss";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" exact>
          <Home />
        </Route>
        <div>
          <nav>
            <ul>
              {/* <li>
